import { Fragment, FunctionComponent } from "react";

declare interface IRadioButtonProps {
label: string;
value: string;
name: string;
checked?: boolean;
}

export const RadioButton: FunctionComponent<IRadioButtonProps> = (props: IRadioButtonProps) =>{
  return (
    <Fragment>
      <div className="flex_row">
        <label>{props.label}</label>
        {props.checked === true ? <input type="radio" value ={props.value} name={props.name} checked={props.checked}/>: <input type="radio" value ={props.value} name={props.name} />} 

        </div>
    </Fragment>
  )

}
